INSERT INTO `promos` (`ID_PROMO`, `POSTER_PROMO`, `KALIMAT_PROMO`, `JENIS_PROMO`, `MINIMAL_TRANSAKSI_PROMO`, `BONUS_TRANSAKSI_PROMO`, `IS_DELETED_PROMO`) VALUES
('353bgP589Zaj5D4N4GbQjaKMuRK7VHgx', NULL, 'Berlaku untuk jenis workout yang sama.\nBayar 5 sesi, gratis 1. Berlaku 1 bulan sejak pembayaran.\nBayar 10, gratis 3. Berlaku 2 bulan sejak pembayaran.\nPada paket ini, setiap kali member mengikuti kelas yang sudah dibeli paketnya, maka yang terpotong adalah jumlah deposit kelasnya, bukan deposit uangnya.\nPembelian paket kelas hanya diperbolehkan jika sisa paket sebelumnya sudah habis, atau sudah hangus (intinya sisa deposit = 0).', 1, 5, 1, NULL),
('92W7xTdEPHVFUzqnwCxfPkQUaevBbaub', NULL, 'Member harus memiliki deposit, dengan minimal deposit Rp.500.000.\nSetiap deposit Rp.3.000.000,- mendapat bonus deposit Rp.300.000,-\nUang yang sudah didepositkan tidak dapat diminta kembali.', 0, 3000000, 300000, NULL);
